import { React } from 'react';
import './UserForm.css'

const UserForm = () => {
    return (
        <form>
            <label> 
                Username
            </label>
                <input type='text'/>
            <label>
                Age (Years)
                <input type='text' />
            </label>
        </form>
    );
}

export default UserForm;
